import Login from './Login';
import React from 'react';
import ThumbUp from '@material-ui/icons/ThumbUp';

function Circle() {

  return (
    <div style={{width:300,height:300,borderRadius:150,borderWidth:3,backgroundColor:"red",justifyContent:"center",alignItems:"center"}}>
        <ThumbUp />
        <div style={{fontSize:20}}>Create a Policy</div>
    </div>
  );
}

export default Circle;
